LC MAP, the Landscape Conservation Management and Analysis Portal, allows GNLCC partners to discover, use, develop, manage, and distribute datasets that address LCC priority issues. In FY11, this effort will extend LCMAP to allow users to generate dynamic interactive map viewers, modeled output, and web services for use in ArcExplorer and other client tools. In addition, the project will build the LCMAP Phenology Service, adding ESRI image services to the application suite and allowing GIS analysts and modelers access to a full suite of phenology data for use in ArcMap and other client tools.

The set of data development and presentation tools planned will allow GIS analysts in the GNLCC community to work with multiple themes inside the GNLCC geospatial portal. Users will be able to work with phenology imagery layers, define presentation options, and deliver on-line viewers that can be used by the GNLCC community at large and, ultimately, the public.

FY2011
Objectives:

1. Engineer a set of spatial tools to allow GNLCC GIS analysts to manage visualization options and data packaging for the GNLCC project geodatabase; 
2. Expose the NASA multi-year phenology imagery layers to ArcMap and ArcExplorer users in a format that allows for analysis of the data on local computers; 
3. Present project geodatabase and visualization packages to other community viewers and decision support systems; 
4. Provide metadata development tools for these combined map services, allowing users to track the origin of the visualizations, and to test the data behind the analysis; and, 
5. Document methods and approach for application to other projects.
